import React, { Component } from "react";
import {Button} from"react-bootstrap";

class Home extends Component {
	state = {
		counter: 0
	};
	render() {
		return ( 
			<main>
				<h1 className="text-center mt-3">Robot Control Page</h1> 
				<h5>
					Counter :
					<span>{ this.state.counter}</span>
				</h5>

			</main>
		);
	}
}

export default Home;
